    [],nt"revision_timestamp": "2016-02-26T22:16:18.783816",nt"name": "in-situ-navigational-physical-and-profile-data-collected-by-royal-netherlands-institute-fo-cf902",nt"isopen":
    false,nt"url": null,nt"notes": "In situ, navigational, physical and profile
    oceanographic data were collected, including CONDUCTIVITY, CURRENT DIRECTION, CURRENT
    SPEED, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT
    (V), DEPTH - OBSERVATION, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE, SALINITY and
    WATER TEMPERATURE from Moored Buoy at the Long-Term Ocean Climate Observations (LOCO)
    Irminger Sea moorings (LOCO-IRMINGSEA) using ADCP, C-T recorder and CTD from 0053-08-28
    to 8110-07-16. These data were provided to one of the OceanSITES Data Assembly Centers
    (DAC). The DAC formatted this information into the OceanSITES file format and passed
    it on to the Global Data Assembly Centers (GDAC).OceanSITES is a worldwide system
    of long-term, open-ocean reference stations measuring dozens of variables and monitoring
    the full depth of the ocean from air-sea interactions down to the seafloor. It is
    a network of stations or observatories measuring many aspects of the ocean's surface
    and water column using, where possible, automated systems with advanced sensors
    and telecommunications systems, yielding high time resolution, often in real-time,
    while building a long record.",nt"license_title": "License Not Specified",nt"extras":
